                     "description": " <br> Grammy-winning producer Jacquire King (Kings of Leon, Tom Waits, Norah Jones, Cold War Kids, Of Monsters and Men, James Bay) produced Current Swells third Nettwek Records Realease, When To Talk and When To Listen. Like all good rock n roll should, When To Talk And When To Listentouches on all facets of the human condition, from the heartbreak and spurned love of first single It Aint Right to a pair of songs about loss that form the emotional core of the album. The group as whole found a new level of confidence on the recording. Some of that can be credited to King, who pushed Current Swell to find a new side of their artistic selves, Stanton says. He would never say something just to say it.Current Swell&#39;s track record in its home country includes two No. 1 singles on iTunes Canadas rock chart and a Top 10 record on the commercial rock charts in Canada for 2014s Ulysses. But all signs point to When To Talk And When To Listen an album of rich songwriting and vibrant musicianship casting a much wider net.A solid fanbase has taken the group across North America several times and into countries such as Brazil, where a pair of headline tours brought them to thousands of rabid fans. &quot;We&#39;re very comfortable in certain parts of the world with our success,&quot; Lang says. &quot;But I know this record is one that can take us to new places.&quot;Now, it is time for Current Swell to push back. Lang says the group will take its music to the world this year, showcasing the heart and soul it took to create When To Talk And When To Listen.Download Biography",
